import React from 'react';
import video from '../assets/Images/Home_vid.webm'

const Home = () => {
  return (
    <div style={{ display: 'flex', alignItems: 'center' }}>
      <div style={{ flex: 1, textAlign: 'center' }}>
        <h1>Welcome to Pillar Watch</h1>
        <p>Discover the latest in Pillar watches.</p>
      </div>
      <div style={{ flex: 3, display: 'flex', justifyContent: 'end' }}>
        <div style={{ width: '75%', paddingBottom: '75%', position: 'relative' }}>
          <iframe
            title="Pillar Watch Video"
            style={{ position: 'absolute', width: '100%', height: 'auto', top: 0, left: 0 }}
            src={video}
            frameBorder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
          ></iframe>
        </div>
      </div>
    </div>
  );
};

export default Home;
